var audioURL = "../../content/spreadsheet-modeling/kepler-tasks/office16/3_hbp_07_06_02_01/3_hbp_07_06_02_01.mp3";
var audioBase64 = "data:audio/mpeg;base64,";

var mp3Elem = document.getElementById("mp3");
var base64Elem = document.getElementById("base64");
var mp3DurationElem = document.getElementById("mp3-ctime");
var base64DurationElem = document.getElementById("base64-ctime");
var loadBtn = document.getElementById("load-btn");
var playBtn = document.getElementById("play-btn");
var pawsBtn = document.getElementById("paws-btn");
var mp3State = 0;
var base64State = 0;

var audioLoadedCount = 0;

var loadIt = function loadIt() {
    mp3Elem.addEventListener("canplaythrough", function () {
        audioLoadedCount++;
        document.getElementById("mp3-duration").innerText = mp3Elem.duration;
        onBothAudioLoad();
    });
    base64Elem.addEventListener("canplaythrough", function () {
        audioLoadedCount++;
        document.getElementById("base64-duration").innerText = base64Elem.duration;
        onBothAudioLoad();
    });

    mp3Elem.addEventListener("timeupdate", function () {
        mp3DurationElem.innerText = mp3Elem.currentTime;
    });
    base64Elem.addEventListener("timeupdate", function () {
        base64DurationElem.innerText = base64Elem.currentTime;
    });

    mp3Elem.addEventListener("error", console.info.bind(null, "mp3 error", mp3Elem.error));
    base64Elem.addEventListener("error", console.info.bind(null, "base64 error", base64Elem.error));

    mp3Elem.addEventListener("play", function () {
        mp3State = 1;
        onPlay();
    });
    base64Elem.addEventListener("play", function () {
        base64State = 1;
        onPlay();
    });

    mp3Elem.addEventListener("pause", function () {
        mp3State = 0;
        onPause();
    });
    base64Elem.addEventListener("pause", function () {
        base64State = 0;
        onPause();
    });

    mp3Elem.src = audioURL;
    base64Elem.src = audioBase64;
};

var onBothAudioLoad = function onBothAudioLoad() {
    if (audioLoadedCount === 2) {
        disableBtn(loadBtn);
        enableBtn(playBtn);
    }
};

var onPlay = function () {
    if (mp3State === 1 && base64State === 1) {
        disableBtn(playBtn);
        enableBtn(pawsBtn);
    }
};

var onPause = function () {
    if (mp3State === 0 && base64State === 0) {
        disableBtn(pawsBtn);
        enableBtn(playBtn);
    }
};

var playIt = function playIt() {
    mp3Elem.play();
    base64Elem.play();
};

var pawsIt = function playIt() {
    mp3Elem.pause();
    base64Elem.pause();
};

var disableBtn = function (btnElem) {
    return btnElem && btnElem.setAttribute && btnElem.setAttribute("disabled", "disabled");
};

var enableBtn = function (btnElem) {
    return btnElem && btnElem.removeAttribute && btnElem.removeAttribute("disabled");
};

loadBtn.addEventListener("click", loadIt);
playBtn.addEventListener("click", playIt);
pawsBtn.addEventListener("click", pawsIt);
document.addEventListener("keypress", function (ev) {
    switch (true) {
        case ev.which === 108:
            loadIt();
            break;
        case ev.which === 97:
            playIt();
            break;
        case ev.which === 115:
            pawsIt();
            break;
    }
});